sys_variable_value.value:
(function execute(inputs, outputs) {

 // Get input values
    let principal = parseFloat(inputs.principal);
    let annualRate = parseFloat(inputs.annualRate);
    let timesCompounded = parseFloat(inputs.timesCompounded);
    let years = parseFloat(inputs.years);

    // Validate inputs
    if (isNaN(principal) || isNaN(annualRate) || isNaN(timesCompounded) || isNaN(years)) {
        outputs.error = "Invalid input values. Please check all inputs.";
        return;
    }

    // Convert annual rate percentage to decimal
    let rate = annualRate / 100;

    // Compound interest formula
    let amount = principal * Math.pow((1 + rate / timesCompounded), timesCompounded * years);

    // Interest earned
    let interest = amount - principal;

    // Set outputs
    outputs.principal = principal.toFixed(2);
    outputs.amount = amount.toFixed(2);
    outputs.interest = interest.toFixed(2);

})(inputs, outputs);

